import React from "react";
import ReactDOM from "react-dom";
import cycle from './cycle.jpg';
import shop3 from './shop3.jpg';
import football from './football.jpg';

const name  = 'Lathesh NT';


ReactDOM.render(
<>
<h1 className='heading'>My name is {name }</h1>

<img src={cycle} width='300px' height='300px' alt='cycle pic'/>
<img src={shop3} width='400px' height='300px' alt='shop pic'/>
<img src={football} width='450px' height='300px' alt='football pic'/>


</>

,document.getElementById('root'));
